results.description:
AdBlock Browser with Chromecast Support since 2012 - The leading Ad-Blocker Browser without any acceptable advertising system.

Over 4 Millionen users can not be wrong. From a just-for-fun independent app to the leading AdBlock Browser app without any acceptable advertising system in the AppStore. 

Connect the app to your Chromecast or AirPlay and stream all videos from your favorite streaming site on your TV!

The Ad-Blocker:
- Blocks banner & pop-up ads
- Blocks YouTube- & other video ads
- Blocks layer ads
- Blocks redirections to free AppStore apps 
- Blocks ringtone subscription traps 

App features:
- Easy to operate;
- Starts ad-blocker automatically;
- Faster download of websites;
- Blocked ads are counted;
- Doesn't save login, key words for search or process;
- Enables you to surf anonymously from iPhone, iPad or iPod touch;
- Full screen mode;
- Delete cache & cookies;
- Allows you to save the desired website under Bookmarks;
- Streaming-Player: Google Chromecast & AirPlay-Support;
- Opens up to eight websites - scrollable tabs;
- Restore open tabs;
- Choose your own start page (klick "return" to save the start page);
- App passcode protection;
- New keyboard with .com & co;
- Show or hide icons;
- If you need: deactivate the ad-blocker;
- Pretends that you surf from a PC (thus enabling you to see websites in original design instead of mobile design);
- Allows you to adjust brightness without leaving the app.


And all this without:
- Any acceptable advertising system
- Tracking or push messages.

